public class FirstUniqueCharacter{

    public static void main(String[] args) {
        //FirstUniqueCharacter.getSubStr();
        FirstUniqueCharacter f = new FirstUniqueCharacter();
        //String s = "leetcode";
        //String s = "z";
        String s = "";
        int result = f.solution(s);
        System.out.println(result);
    }
    private static void getSubStr(){
        String s = "first";
        String s0 = s.substring(0,0);
        boolean b = s.contains(s0);
       // System.out.println(s0 + "," + b);
        int i = s.indexOf(s0);
        int l = s.lastIndexOf(s0);
        System.out.println(i+","+l);

    }

    public int solution(String s){
        for(int i=0;i<s.length();i++){
            String fetchOneChar = s.substring(i,i+1);
            // String releaseStr = s.substring(i+1,s.length());
            // System.out.println(fetchOneChar+","+releaseStr);
            // if (!releaseStr.contains(fetchOneChar)){
            //     return i;
            // }
            int b = s.indexOf(fetchOneChar);
            int e = s.lastIndexOf(fetchOneChar);
            if(i == b && b == e){
                return i;
            }
        }
        return -1;
    }
}